					<div class="elementor-text-editor elementor-clearfix"><p class="MsoNormal"><span lang="EN-AU">The Coffee Can started in May 2014, Mr Can having had a long running ambition to run a coffee van. After an extensive search of vans to buy, the decision was made to have the van custom built at Bella Manufacturing on the Sunshine Coast. Having the van custom built allows the van to be practical seven days a week, four years on.</span></p><p class="MsoNormal"><span lang="EN-AU">The Coffee Can Café came about when the decision between another van, and a set location had to be made. The Corner store on Michaelangelo, Redlynch was purchased in September 2017 and is the location of the café. Having a set location added to the reputation for great coffee every time, with excellent customer service.</span></p><p class="MsoNormal"><span style="font-size: 1rem;">There is now a Coffee Can ‘Cart’ which is used at corporate events and as an additional platform for indoor bookings.</span></p></div>
